import React from 'react';
import * as FaIcons from 'react-icons/fa';

// Create wrapper components for each icon
export const FaHome: React.FC<any> = (props) => <FaIcons.FaHome {...props} />;
export const FaSearch: React.FC<any> = (props) => <FaIcons.FaSearch {...props} />;
export const FaList: React.FC<any> = (props) => <FaIcons.FaList {...props} />;
export const FaTrophy: React.FC<any> = (props) => <FaIcons.FaTrophy {...props} />;
export const FaPlay: React.FC<any> = (props) => <FaIcons.FaPlay {...props} />;
export const FaPause: React.FC<any> = (props) => <FaIcons.FaPause {...props} />;
export const FaStepForward: React.FC<any> = (props) => <FaIcons.FaStepForward {...props} />;
export const FaStepBackward: React.FC<any> = (props) => <FaIcons.FaStepBackward {...props} />;
export const FaVolumeUp: React.FC<any> = (props) => <FaIcons.FaVolumeUp {...props} />;
export const FaVolumeMute: React.FC<any> = (props) => <FaIcons.FaVolumeMute {...props} />;
export const FaPlus: React.FC<any> = (props) => <FaIcons.FaPlus {...props} />;
export const FaMusic: React.FC<any> = (props) => <FaIcons.FaMusic {...props} />;
export const FaCheckCircle: React.FC<any> = (props) => <FaIcons.FaCheckCircle {...props} />;
export const FaPlayCircle: React.FC<any> = (props) => <FaIcons.FaPlayCircle {...props} />;
export const FaClock: React.FC<any> = (props) => <FaIcons.FaClock {...props} />;
export const FaFire: React.FC<any> = (props) => <FaIcons.FaFire {...props} />;
